    <meta http-equiv="X-UA-Compatible" content="IE=edge">

    <meta name="theme-color" content="#ffffff">
    <title>App Test</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Bebas+Neue&family=Poppins:wght@200;300;400;600;900&display=swap" rel="stylesheet">

    <style>
        /* 
* Ajouter font 
* A chargement les photos doivent légéremenr bouger sur la gauche ou la droite 
*/
body {
    margin: 0;
    padding: 0;
    overflow: hidden;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #ffffff;
    /* font-family: Arial, sans-serif; */
    font-family: "Bebas Neue", sans-serif;
}

#app {
    width: 100vw;
    height: 100vh;
    position: relative;
    overflow: hidden;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #fff;
}

#close-button {
    position: absolute;
    top: 10px;
    right: 10px;
    z-index: 999;
    width: 30px;
    height: 30px;
}

#close-button img {
    width: 100%;
    height: 100%;
    position: relative;
    opacity: 0.2;
    transition: opacity 0.5s ease-out;
    z-index: 2;
}

#progress-circle {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    border-radius: 50%;
    box-sizing: border-box;
    border: 2px solid blue;
    z-index: 1;
    opacity: 0.5;
    animation: shrink-border 10s linear forwards;
    transition: border 0.5s ease-out;
}

#close-button.active img {
    opacity: 1;
}

.image-container {
    position: absolute;
    width: 80%;
    height: 70%;
    background-size: cover;
    background-position: center;
    transition: transform 0.5s ease-out, opacity 0.5s ease-out;
    opacity: 1;
    border-radius: 12px;
}

.image-container.hidden {
    opacity: 0;
}
#icons {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    pointer-events: none; 
}
  
.icon {
    opacity: 0;
    transition: opacity 0.5s ease-out;
    position: absolute;
}

.cta img{
    width: 10vh;
    display: grid;
    margin: auto;
}

.cta h2{
    margin: 4vh 0 1vh;
}
  
#icon-heart, #icon-x {
    position: absolute;
    top: 50%; 
    transform: translateY(-50%); 
    width: 80px;
    height: 80px;
    opacity: 0; 
    transition: opacity 0.5s ease; 
    z-index: 10; 
}

#icon-heart {
    left: 10vh; 
}

#icon-x {
    right: 10vh;
}


/* Header logo */
header {
    position: absolute;
    top: -1%;
    left: 0;
    right: 0;
    text-align: center;
    z-index: 999; 
    transition: top .5s ease-out;
}

header img {
    max-width: 20vh; 
    height: auto; 
    display: block; 
    margin: 5vh auto; 
    transition: max-width .8s ease-out;
    
}

/* test confetti  */
.cta-container {
    position: absolute;
    z-index: 999;
    opacity: 0;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    padding: 1.5px;
    border-radius: 12px;
    background: transparent; 
    animation: gradient-border 20s ease-in-out infinite;
    text-align: center;
    --s: 10px; /* the spread-radius */
    transform-style: preserve-3d;
    animation: gradient-border 20s ease-in-out infinite;
}

.cta-container:before {
    content: "";
    position: absolute;
    inset: 0px;
    transform: translate3d(0px, 0px, -1px);
    background: linear-gradient(135deg, #ff6a00, #ff007a, #007bff); 
    filter: blur(30px);
    border-radius: inherit;
    animation: pulse 5s infinite; 
}

.cta {
    padding: 10px 20px;
    font-size: 16px;
    border: none;
    border-radius: 10px;
    background-color: #fff;
    cursor: pointer;
}

/* Wrapper pour les confettis */
.confetti-wrapper {
    position: absolute;
    width: 100vw;
    height: 100vh;
    top: 0;
    left: 0;
    overflow: hidden;
    pointer-events: none;
    z-index: 0;
}


/* Bottom icons */
#bottom-icons {
    position: absolute;
    bottom: 17.5vh;
    width: 66%;
    display: flex;
    justify-content: space-between; 
    padding: 0 20px;
    opacity: 1;
    transition: opacity .5s ease-out;
}

#bottom-heart, #bottom-x{
    position: relative;
    background-color: #fff;
    border-radius: 50%;
    padding: 10px;
}

/* Mockup iphone */
#show-mobile-app {
    position: fixed; 
    width: 250px; 
    height: 550px;
    opacity: 0;
    display: none;
    transition: all 2s ease-out;
    top: 55%; 
    left: 50%; 
    transform: translate(-50%, -50%); 
}

.mockup {
    width: 100%; 
    height: auto;
}

.logo {
    position: absolute;
    width: 70%; 
    top: 50%;  
    left: 50%; 
    transform: translate(-50%, -50%); 
    height: auto;
}

#stores_icons{
    display: none; 
    justify-content: space-between; 
    opacity: 0;
    display: none;
    position: absolute;
    bottom: 16%;
    transition: opacity .5s ease-out;
}

#stores_icons div{
    display: flex;
    justify-content: space-between; 
    margin-top: 3vh;
}

#stores_icons p{
    margin: 2vh 0;
    text-align: center;
}

#stores_icons svg{
    opacity: 1;
    margin: 0 5vh;
    position: relative;
    color: #333333!important;
}


@keyframes pulse {
    0%, 100% {
        inset: -2px; 
        transform: translate3d(0px, 0px, -1px); 
    }
    50% {
        inset: 8px; 
        transform: translate3d(3px, 7px, -1px); 
    }
}

@keyframes gradient-border {
    0% {
        background: linear-gradient(135deg, #ff6a00, #ff007a, #007bff);
        background-position: 0% 50%;
    }
    25% {
        background: linear-gradient(145deg, #ff720d, #fe0d81, #0c81fd);
        background-position: 50% 50%;
    }
    50% {
        background: linear-gradient(155deg, #fc7312, #fb1684, #1686fe);
        background-position: 100% 50%;
    }
    75% {
        background: linear-gradient(165deg, #fc6f0b, #ff0c82, #0d81fe);
        background-position: 50% 50%;
    }
    100% {
        background: linear-gradient(135deg, #ff6a00, #ff007a, #007bff);
        background-position: 0% 50%;
    }
}

@keyframes shrink-border {
    0% {
      border-width: 4px;
    }
    100% {
      border-width: 0;
    }
}

/* Landscape */
@media only screen and (min-device-width: 375px) and (max-device-width: 428px) and (-webkit-device-pixel-ratio: 3) and (orientation: landscape) {
    #app{
        height: 80vh;
    }

    #show-mobile-app, .cta-container{
        left: 25%; 
    }

    #stores_icons{
        right: 22vh;
        bottom: 20%;
    }

    header{
        top: 25%;
        right: 30vh;
        left: inherit;
        /* right: -80%; */
    }

    header img {
        max-width: 60vh; 
        height: auto; 
        display: block; 
    
    }

    .image-container {
        position: absolute;
        width: 30%;
        height: 70%;
        left: 10%;
    }

    #bottom-icons{
        width: 25%;
        left: 10%;
        bottom: 14.5vh;
    }

    #icon-heart {
        left: -30vh; 
    }
    
    #icon-x {
        left: -90vh;
    }

}

/* Portrait */
@media only screen and (min-device-width: 375px) and (max-device-width: 428px) and (-webkit-device-pixel-ratio: 3) and (orientation: portrait) {
    header{
        top: 0%;
    }

    .image-container{
        top: 16%;
    }
}

        images.forEach((img, index) => {
            document.querySelector(img).style.backgroundImage = `url(${imageSources[index]})`;
            if (index > 0) {
            document.querySelector(img).style.opacity = '0'; 
            document.querySelector(img).style.display = 'none';
            }
        });


        function animateImgNoInteraction(imageElement) {
            gsap.timeline({ repeat: 0, yoyo: true }) 
                .to(imageElement, {
                    duration: 0.5, 
                    x: 20, 
                    rotation: 8, 
                    ease: "power1.inOut" 
                })
                .to(imageElement, {
                    duration: 0.3, 
                    x: 0, 
                    rotation: 0, 
                    ease: "power1.inOut" // Return to center
                })
                .to(imageElement, {
                    duration: 0.5, 
                    x: -20, 
                    rotation: -8, 
                    ease: "power1.inOut" // Translation and rotation to the left
                })
                .to(imageElement, {
                    duration: 0.3, 
                    x: 0, 
                    rotation: 0, 
                    ease: "power1.inOut" // Return to center
                });
        }

        // Function to start animation after 4 seconds of inactivity
        function startInactivityTimeout(seconds) {
            inactivityTimeout = setTimeout(() => {
                animateImgNoInteraction(first_img); 
            }, seconds);
        }

        function resetInactivityTimeout() {
            clearTimeout(inactivityTimeout); 
            startInactivityTimeout(); 
        }

        // When ad loaded 100ms
        startInactivityTimeout(100);

        // if no activities after 4s
        startInactivityTimeout(4000);

  
        document.addEventListener('touchstart', handleTouchStart, false);
        document.addEventListener('touchmove', handleTouchMove, false);
        document.addEventListener('touchend', handleTouchEnd, false);
  
        function handleTouchStart(evt) {
            initPositionX = evt.touches[0].clientX;
            isDragging = true;
        }
        
        function handleTouchMove(evt) {
            if (!initPositionX || !isDragging || !isSwipeEnabled) return;
        
            let xUp = evt.touches[0].clientX;
            diffInitPosX = xUp - initPositionX;
        
            const currentImageElement = document.querySelector(images[currentImage - 1]);
            
            currentImageElement.style.transform = `translateX(${diffInitPosX}px)`;
        
            if (diffInitPosX > 0) {
                showIcon(iconHeart);
                hideIcon(iconX);
            } else {
                showIcon(iconX);
                hideIcon(iconHeart);
            }
        }
        
        function handleTouchEnd() {
            if (!initPositionX || !isSwipeEnabled) return;
        
            const currentImageElement = document.querySelector(images[currentImage - 1]);
        
            const screenWidth = window.innerWidth;
            const threshold = 0.1 * screenWidth; 
        
            if (Math.abs(diffInitPosX) > threshold) {
                if (diffInitPosX > 0) {
                    rightImage(); 
                } else {
                    leftImage(); 
                }
            } else {
                resetImagePosition(currentImageElement); 
            }
        
            initPositionX = null;
            diffInitPosX = null;
            isDragging = false;
            setTimeout(() => {
                hideIcon(iconHeart);
                hideIcon(iconX);
            }, 500);
        }
        
        function showIcon(icon) {
            icon.style.opacity = '1';
        }
    
        function hideIcon(icon) {
            icon.style.opacity = '0';
        }
        
        function rightImage() {
            if (currentImage < totalSwipes) {
                const currentImageElement = document.querySelector(images[currentImage - 1]);
                const rightImageElement = document.querySelector(images[currentImage]);
            
                currentImageElement.style.transition = 'transform 0.5s ease-out, opacity 0.5s ease-out';
                currentImageElement.style.transform = 'translateX(100%) rotate(20deg)'; 
                currentImageElement.style.opacity = '0';
        
                setTimeout(() => {
                    currentImageElement.style.display = 'none'; 
                    currentImage++; 
                    rightImageElement.style.display = 'block'; 
                    rightImageElement.style.opacity = '1';
                    rightImageElement.style.transform = 'translateX(0) rotate(0deg)'; 
                }, 500);
            } else {
                showMockup()
            }
        }
        
        function leftImage() {
            if (currentImage < totalSwipes) {
                const currentImageElement = document.querySelector(images[currentImage - 1]);
                const rightImageElement = document.querySelector(images[currentImage]);
            
                currentImageElement.style.transition = 'transform 0.5s ease-out, opacity 0.5s ease-out';
                currentImageElement.style.transform = 'translateX(-100%) rotate(-20deg)';
                currentImageElement.style.opacity = '0';
        
                setTimeout(() => {
                    currentImageElement.style.display = 'none'; 
                    rightImageElement.style.display = 'block'; 
                    rightImageElement.style.opacity = '1'; 
                    rightImageElement.style.transform = 'translateX(0) rotate(0deg)'; 
                    currentImage++; 
                }, 500);
            } else {
                showMockup()
            }
        }
        
        function resetImagePosition(currentImageElement) {
            currentImageElement.style.transition = 'transform 0.3s ease-out';
            currentImageElement.style.transform = 'translateX(0) rotate(0deg)';
        }
        
        function showEndCard() {
            cta.style.opacity = '1';
            app_main.style.position = "absolute";
            header.style.top = '12%'
            headerImg.style.maxWidth = "36vh"
            stores_icons.style.display = "block"
            setTimeout(() => {
                stores_icons.style.opacity = "1"
            }, 0);
            initThreeJsScene();
        
            ctaContainer.addEventListener('click', function () {
                const userAgent = navigator.userAgent.toLowerCase();
            
                if (userAgent.includes('android')) {
                    if (typeof mraid !== 'undefined' && mraid.open) {
                        mraid.open('https://play.google.com/store/apps/details?id=com.tinder&hl=fr'); 
                    } else {
                        window.location.href = 'https://play.google.com/store/apps/details?id=com.tinder&hl=fr';
                    }
                } else if (userAgent.includes('iphone') || userAgent.includes('ipad')) {
                    if (typeof mraid !== 'undefined' && mraid.open) {
                        mraid.open('https://apps.apple.com/fr/app/tinder-app-de-rencontre/id547702041'); 
                    } else {
                        window.location.href = 'https://apps.apple.com/fr/app/tinder-app-de-rencontre/id547702041'; 
                    }
                } else {
                    window.location.href = 'https://tinder.com'; 
                }
            });
        }
        
        if (typeof mraid !== 'undefined') {
            mraid.addEventListener('ready', function () {
                console.log("MRAID ready");
            });
        }

        function initThreeJsScene() {
            scene = new THREE.Scene();
            camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);
            const renderer = new THREE.WebGLRenderer({ alpha: true }); 
            renderer.setSize(window.innerWidth, window.innerHeight);

            document.body.appendChild(renderer.domElement);

            renderer.domElement.style.position = 'relative';


            const light = new THREE.AmbientLight( 0xffffff, 4 ); 
            light.position.set(0, 1, 1).normalize();
            scene.add(light);

            const pointLight = new THREE.PointLight( 0xff0000, 35, 200 );
            pointLight.position.set( 0, 0, 0 );
            scene.add( pointLight );

            camera.position.z = 5;

            const loader = new GLTFLoader();
            loader.load('./models/heart_2/scene.gltf', function(gltf) {
                const model = gltf.scene;

                function getRandomInRange(min, max) {
                    return Math.random() * (max - min) + min;
                }
                
                const colors = [
                    0xFF0000, // Red
                    0xDC143C, // Crimson
                    0x8B0000, // Dark Red
                    0xB22222, // Firebrick
                    0xFF69B4  // Hotpink
                ];
                
                
                function getRandomColor() {
                    const randomIndex = Math.floor(Math.random() * colors.length);
                    return colors[randomIndex];
                }

                model.traverse((child) => {
                    if (child.isMesh) {
                        const newMaterial = new THREE.MeshStandardMaterial({
                            color: getRandomColor(), 
                            emissive: getRandomColor(),
                            roughness: getRandomInRange(0, 0.5), 
                            metalness: getRandomInRange(0.6, 1), 
                        });
                        child.material = newMaterial; 
                    }
                });

                function addFloatingModel() {
                    const modelClone = model.clone(); 

                    modelClone.position.set(
                        Math.random() * 10 - 5, 
                        -5, 
                        Math.random() * 5 - 5 
                    );

                    modelClone.scale.set(0.05, 0.05, 0.05);

                    const newMaterial = new THREE.MeshStandardMaterial({
                        color: getRandomColor(), 
                        emissive: getRandomColor(),
                        roughness: getRandomInRange(0, 0.5), 
                        metalness: getRandomInRange(0.5, 1)  
                    });

                    modelClone.traverse((child) => {
                        if (child.isMesh) {
                            child.material = newMaterial; 
                        }
                    });

                    const randomScale = 0.02 + Math.random() * (0.05 - 0.02);  

                    gsap.to(modelClone.scale, {
                        x: randomScale,   
                        y: randomScale,   
                        z: randomScale,  
                        duration: 1 + Math.random(), 
                        ease: "power1.out",        
                    });
                    scene.add(modelClone);

                    const speed = 0.01 + Math.random() * 0.02; 
                    let oscillationSpeed = Math.random() * 0.02;

                    function animateFloatingModel() {
                        modelClone.position.y += speed;

                        modelClone.position.x += Math.sin(Date.now() * 0.001 * oscillationSpeed) * 0.05;

                        if (modelClone.position.y > 5) {
                            scene.remove(modelClone);
                        } else {
                            requestAnimationFrame(animateFloatingModel); 
                        }

                        renderer.render(scene, camera); 
                    }

                    animateFloatingModel();
                }

                setInterval(() => {
                    addFloatingModel(); 
                }, 1000); 

                function animate() {
                    requestAnimationFrame(animate);
                    renderer.render(scene, camera);
                }

                animate();
            }, undefined, function(error) {
                console.error('Erreur: ', error);
            });
        }

        function detectObjectClick() {
            raycaster.setFromCamera(mouse, camera);
        
            const intersects = raycaster.intersectObjects(scene.children, true);
        
            if (intersects.length > 0) {
                const clickedObject = intersects[0].object;
                
                gsap.to(clickedObject.scale, {
                    x: 0,   
                    y: 0,   
                    z: 0,  
                    duration: 0.5,
                    ease: "power1.inOut",
                    onComplete: () => {
                        scene.remove(clickedObject);
        
                        launchConfetti();
                    }
                });
            }
        }
                    

        const raycaster = new THREE.Raycaster();
        const mouse = new THREE.Vector2();
        let isTouchDevice = 'ontouchstart' in window || navigator.msMaxTouchPoints > 0;

        if (isTouchDevice) {
            window.addEventListener('touchstart', onTouchStart, false);
        } else {
            window.addEventListener('click', onMouseClick, false);
        }

        function onMouseClick(event) {

            if (!camera) {
                return; 
            }

            mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
            mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

            detectObjectClick();
        }

        function onTouchStart(event) {
            if (event.touches.length === 1) { 
                const touch = event.touches[0];

                mouse.x = (touch.clientX / window.innerWidth) * 2 - 1;
                mouse.y = -(touch.clientY / window.innerHeight) * 2 + 1;

                detectObjectClick();
            }
        }

        function showMockup() {
            isSwipeEnabled = false;

            images.forEach(img => {
                document.querySelector(img).style.display = 'none';
            });
            bottomIcons.style.opacity = 0;
        
            showMobileApp.style.display = 'block';
            showMobileApp.style.opacity = '1';
            setTimeout(() => {
                showMobileApp.style.width = '100px';
                showMobileApp.style.height = '200px';
            }, 500);
        
            setTimeout(() => {
                showMobileApp.style.opacity = 0;
            }, 2600);
        
            setTimeout(() => {
                showMobileApp.style.display = 'none';
                showEndCard();
        
            }, 3100);
        }

        function launchConfetti() {
            const duration = 1000; 
            const animationEnd = Date.now() + duration;
            const defaults = { 
                spread: 360, 
                startVelocity: 30, 
                ticks: 100, 
                decay: 0.94,
                gravity: 0,
                zIndex: 0, 
                shapes: ["circle", "squere"] 
            };

            function randomInRange(min, max) {
                return Math.random() * (max - min) + min;
            }

            const interval = setInterval(function() {
                const timeLeft = animationEnd - Date.now();

                if (timeLeft <= 0) {
                    return clearInterval(interval);
                }

                const particleCount = 50 * (timeLeft / duration);

                confetti(Object.assign({}, defaults, {
                    particleCount,
                    origin: { x: randomInRange(0.1, 0.3), y: Math.random() - 0.2 }
                }));

                confetti(Object.assign({}, defaults, {
                    particleCount,
                    origin: { x: randomInRange(0.7, 0.9), y: Math.random() - 0.2 }
                }));

                confetti(Object.assign({}, defaults, {
                    particleCount: 20,
                    scalar: 2, 
                    shapes: ["text"], 
                    shapeOptions: {
                        text: {
                            value: ["❤️", "🍉", "🍇", "🍒"] 
                        }
                    },
                    origin: { x: 0.5, y: 0.5 }
                }));
            }, 250);
        }

        const bottomHeart = document.getElementById('bottom-heart');
        const bottomX = document.getElementById('bottom-x');

        bottomHeart.addEventListener('click', () => {
            rightImage();
        });

        bottomX.addEventListener('click', () => {
            leftImage();
        });

        function showBottomIcons() {
            bottomHeart.style.opacity = '1';
            bottomX.style.opacity = '1';
        }

        setTimeout(() => {
            const closeButton = document.getElementById("close-button");
            closeButton.classList.add("active"); 
            
            closeButton.addEventListener('click', () => {
                alert("Closing ad... \nReload the page");
                window.location.reload()
            });
        }, 10000);

        showBottomIcons();

    </script>
</body>
</html>
